import React, { useState } from 'react';
import AppBar from '@mui/material/AppBar';
import Button from '@mui/material/Button';
import LocalGroceryStoreIcon from '@mui/icons-material/LocalGroceryStore';
import LogoutIcon from '@mui/icons-material/Logout';
import CssBaseline from '@mui/material/CssBaseline';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import { Link as RouterLink, useNavigate } from 'react-router-dom';
import { Box, Container, MenuItem} from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import './homeStyle.css'
import httpService from '../../services/httpService'

const Home = () => {

    const [anchorEl, setAnchorEl] = useState(null);

  const handleMenuClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

    const handleSignOut = () => {
        localStorage.removeItem("token")
      }
  return (
    <>
        <CssBaseline />
        <AppBar position="relative">
          <Toolbar>
            <Button onClick={handleMenuClick}>
            Menu
          </Button>
          <Popover
            open={Boolean(anchorEl)}
            anchorEl={anchorEl}
            onClose={handleClose}
            anchorOrigin={{
              vertical: 'bottom',
              horizontal: 'right',
            }}
            transformOrigin={{
              vertical: 'top',
              horizontal: 'right',
            }}
          >
            <Box sx={{ p: 2 }}>
              <MenuItem component={RouterLink} to="/account" onClick={handleClose}>
                <AccountCircleIcon sx={{ marginRight: 1 }} />
                Conta
              </MenuItem>
              <MenuItem component={RouterLink} to="/library" onClick={handleClose}>
                Biblioteca
              </MenuItem>
              <MenuItem onClick={handleSignOut}>
                <LogoutIcon sx={{ marginRight: 1 }} />
                Sair
              </MenuItem>
            </Box>
          </Popover>
            <Box className='moviePlay'>
                <Typography variant="h6" color="inherit" noWrap className='moviePlay_text'>
                    MoviePlay
                </Typography>
            </Box>
  
            <Box style={{ display: 'flex', alignItems: 'center', marginLeft: 'auto' }}>
                <AccountCircleIcon fontSize='large'/>
            </Box>
          </Toolbar>
        </AppBar>
    </> 
  )
}

export default Home
